import { Component } from '@angular/core';

@Component({
  selector: 'app-doar',
  templateUrl: './doar.component.html',
  styleUrls: ['./doar.component.css']
})
export class DoarComponent {

  mostrar: boolean = false;

  mostrarDivAlert(){
    this.mostrar = true;
  }

}
